import React, { useEffect, useState } from 'react';
import { Button, Form, Modal, Table, Alert } from 'react-bootstrap';
import axios from 'axios';

const UsersAdmin = () => {
  const [users, setUsers] = useState([]);
  const [showModal, setShowModal] = useState(false);
  const [formData, setFormData] = useState({
    name: '',
    surname: '',
    patronymic: '',
    email: '',
    phone: '',
    role: '',
  });
  const [editingUser, setEditingUser] = useState(null);
  const [errorMessage, setErrorMessage] = useState('');
  const token = localStorage.getItem('token');

  useEffect(() => {
    const fetchUsers = async () => {
      try {
        const response = await axios.get('http://localhost:3000/api/user/auth', {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });
        setUsers(response.data);
      } catch (error) {
        console.error('Error fetching users:', error);
      }
    };

    fetchUsers();
  }, [token]);

  const handleShowModal = () => setShowModal(true);
  const handleCloseModal = () => {
    setShowModal(false);
    setFormData({
      name: '',
      surname: '',
      patronymic: '',
      email: '',
      phone: '',
      role: '',
    });
    setEditingUser(null);
    setErrorMessage('');
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.put(`http://localhost:3000/api/user/${editingUser.id}`, formData, {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      });
      setUsers(users.map(user => user.id === editingUser.id ? { ...user, ...formData } : user));
      handleCloseModal();
    } catch (error) {
      console.error('Error submitting user:', error);
      setErrorMessage('Ошибка при отправке данных пользователя. Пожалуйста, попробуйте снова.');
    }
  };

  const handleEdit = (user) => {
    setEditingUser(user);
    setFormData({
      name: user.name,
      surname: user.surname,
      patronymic: user.patronymic,
      email: user.email,
      phone: user.phone,
      role: user.role,
    });
    handleShowModal();
  };

  const handleDelete = async (id) => {
    try {
      await axios.delete(`http://localhost:3000/api/user/${id}`, {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      });
      setUsers(users.filter(user => user.id !== id));
    } catch (error) {
      if (error.response && error.response.status === 500) {
        setErrorMessage('Нельзя удалить пользователя.');
      } else {
        console.error('Error deleting user:', error);
        setErrorMessage('Ошибка при удалении пользователя. Пожалуйста, попробуйте снова.');
      }
    }
  };

  return (
    <div style={{ maxWidth: '1000px', margin: '20px auto' }}>
      {errorMessage && <Alert variant="danger" onClose={() => setErrorMessage('')} dismissible>{errorMessage}</Alert>}
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>Имя</th>
            <th>Фамилия</th>
            <th>Отчество</th>
            <th>Email</th>
            <th>Телефон</th>
            <th>Роль</th>
            <th>Действия</th>
          </tr>
        </thead>
        <tbody>
          {users.map(user => (
            <tr key={user.id}>
              <td>{user.name}</td>
              <td>{user.surname}</td>
              <td>{user.patronymic}</td>
              <td>{user.email}</td>
              <td>{user.phone}</td>
              <td>{user.role}</td>
              <td style={{ display: 'flex', justifyContent: 'end' }}>
                <Button variant="warning" onClick={() => handleEdit(user)} style={{ marginRight: '10px' }}>
                  Редактировать
                </Button>
                <Button variant="danger" onClick={() => handleDelete(user.id)}>
                  Удалить
                </Button>
              </td>
            </tr>
          ))}
        </tbody>
      </Table>

      <Modal show={showModal} onHide={handleCloseModal}>
        <Modal.Header closeButton>
          <Modal.Title>Редактировать пользователя</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <Form onSubmit={handleSubmit}>
            <Form.Group controlId="formUserName">
              <Form.Label>Имя</Form.Label>
              <Form.Control
                type="text"
                name="name"
                placeholder="Введите имя"
                value={formData.name}
                onChange={handleChange}
                required
              />
            </Form.Group>
            <Form.Group controlId="formUserSurname">
              <Form.Label>Фамилия</Form.Label>
              <Form.Control
                type="text"
                name="surname"
                placeholder="Введите фамилию"
                value={formData.surname}
                onChange={handleChange}
                required
              />
            </Form.Group>
            <Form.Group controlId="formUserPatronymic">
              <Form.Label>Отчество</Form.Label>
              <Form.Control
                type="text"
                name="patronymic"
                placeholder="Введите отчество"
                value={formData.patronymic}
                onChange={handleChange}
                required
              />
            </Form.Group>
            <Form.Group controlId="formUserEmail">
              <Form.Label>Email</Form.Label>
              <Form.Control
                type="email"
                name="email"
                placeholder="Введите email"
                value={formData.email}
                onChange={handleChange}
                required
              />
            </Form.Group>
            <Form.Group controlId="formUserPhone">
              <Form.Label>Телефон</Form.Label>
              <Form.Control
                type="text"
                name="phone"
                placeholder="Введите номер телефона"
                value={formData.phone}
                onChange={handleChange}
                required
              />
            </Form.Group>
            <Form.Group controlId="formUserRole">
              <Form.Label>Роль</Form.Label>
              <Form.Control
                as="select"
                name="role"
                value={formData.role}
                onChange={handleChange}
                required
              >
                <option value="USER">Пользователь</option>
                <option value="ADMIN">Администратор</option>
              </Form.Control>
            </Form.Group>
            <Button variant="primary" type="submit" style={{ marginTop: '20px' }}>
              Сохранить
            </Button>
          </Form>
        </Modal.Body>
      </Modal>
    </div>
  );
};

export default UsersAdmin;
